 - mediated apoptosis .

 - induced apoptosis was effectively blocked by the overexpression of Bcl - 2 , and Bax / Bak deficient mouse embryonic fibroblasts were also resistant to apoptosis , indicating a central role for the pro-apoptotic proteins of this family in auranofin-triggered apoptosis .

<div class="entities" style="line-height: 2.5; direction: ltr">In utero and lactational exposure to 2,3 , 7,8- tetrachlorodibenzo-p-dioxin alters postnatal development of seminal vesicle epithelium . 2,3 , 7,8- Tetrachlorodibenzo-p-dioxin ( TCDD ) has been shown to alter male reproductive development of laboratory animals through in utero and lactational exposure . As a result of exposure , the accessory glands of the male reproductive tract , including the seminal vesicle , are decreased in size as determined by total weight of the tissue . Analysis of seminal vesicle weights over time suggests that the changes may be transient . Administration of 1.0 microg / kg TCDD during gestation caused a significant decrease in seminal vesicle weights of offspring 8-11 months of age . We examined the effects of TCDD on seminal vesicles from rats exposed in utero and lactationally . Pregnant Long Evans rats were gavaged on gestation day 15 with 1.0 microg / kg TCDD in corn oil . Male pups were euthanized and necropsied on postnatal days (

 mRNA expression in

 significantly impaired behavioral performance and cortical activation at the lateral prefrontal cortex in the working memory task , compared with epinastine and placebo . There were no sedative effects on neural response or behavioral performance after epinastine administration . This paper demonstrates for the first time differential sedation effects of first - and second-generation antihistamines on brain hemodynamic response in young children . Also discussed is the utility of the NIRS technique in neuropsychopharmacological studies of children .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Identification of novel androgen receptor antagonists using structure - and ligand-based methods .

 ( AR ) plays a critical role in the development and progression of prostate cancer ( PCa ) . The AR hormone-binding site ( HBS ) is intensively studied and represents the target area for current antiandrogens including DB01128 and structurally related 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #CC9966); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>

<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 . As resistance to antiandrogens invariably emerges in advanced prostate cancer , there exists a high medical need for the identification and development of novel AR antagonists of different chemotypes . Given the wealth of structural information on the AR in complex with a variety of ligands , we have applied an integrated structure - and ligand-based virtual screening methodology to identify novel AR antagonists . Virtual hits generated by a consensus voting approach were experimentally evaluated and resulted in the discovery of a number of structurally diverse submicromolar antagonists of the AR . In particular , one identified compound demonstrated anti-AR potency in vitro that is comparable to the clinically used DB01128 . These results set a ground for the development of novel classes of PCa drugs that are structurally different from current AR antagonists .</div>
